import React, { Component } from 'react';
import './Table.css';
import tableJSON from "../Assets/table-json"
class Table extends Component {
    render() {
        let tableheader = null, tablerows = null;
        tableheader = tableJSON.columnHeaders.map(colheaderData => {
            return (
                <th key={colheaderData.id} id={colheaderData.id} label={colheaderData.label}
                    data-sortable={colheaderData.id}
                    data-filterable={colheaderData.filterable}>
                    {colheaderData.label}
                </th>
            )
        })
        tablerows = tableJSON.rowData.map(rowData => {
            return (
                <tr key={rowData.id} id={rowData.id}>
                    {/* <td data-label={rowData.data[0].id}>
                        {rowData.data[0].value}
                    </td>
                    <td data-label={rowData.data[1].id}>
                        {rowData.data[1].value}
                    </td>
                    <td data-label={rowData.data[2].id}>
                        {rowData.data[2].value}
                    </td>
                    <td data-label={rowData.data[3].id}>
                        {rowData.data[3].value}
                    </td>
                    <td data-label={rowData.data[4].id}>
                        {rowData.data[4].value}
                    </td> */}
                    {rowData.data.map((rowDataConf,ind) => {
                        return(
                            <td key={rowDataConf.id}>
                                {rowDataConf.value}
                            </td>
                        )
                    })}
                </tr>
            )
        })
        return (
            <div className="Table-wraper">
                <table>
                    <tr>
                        {tableheader}
                    </tr>
                    <tbody>
                        {tablerows}
                    </tbody>
                </table>
            </div>
        );
    }
}
export default Table;
